import React from 'react';
import ReactDOM from 'react-dom';
import AuthContextProvider from './components/context/AuthContext';
import './index.css';
import App from './App';

ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <AuthContextProvider>
      <App />
    </AuthContextProvider>
  </React.StrictMode>
);


